		//addresses := decoded[4].([]common.Address)
		//repayAmount := decoded[5].(*big.Int)

		////tx, err =qs.Qingsuan(auth, big.NewInt(1), flashLoanFrom, emptyPath, emptyPath, addresses, repayAmount)
		//tx, err = syncer.doLiquidation(scenarioNum, flashLoanFrom, path1, path2, addresses, repayAmount, gasPrice)
		//require.NoError(t, err)
